        <>
            {baskets.map((basket, index) => (
                basket.Count > 0 ? < Merchandise key={index} merchandise={basket} substractFromCounter={substractFromCounter} addToCounter={addToCounter} showCheckOut={showCheckOut}></Merchandise> : ''
            ))}
        </>
    )
}

